function Cart(props) {
	console.log(props.myContacts.imgURL);
	return(
		<div>
			<h2>{props.myContacts.name}</h2>
			<img src={props.myContacts.imgURL}/>
			<p>{props.myContacts.phone}</p>
			<p>{props.myContacts.email}</p>
		</div>
	)
}

export default Cart;
